(function($) {
 	$.fn.fitImages = function() { 			
		return this.each(function() {
			
			var $obj = $(this);
			var $imgs = $(this).find("img");
			
			$imgs.each(function(){
			
				var $img = $(this);
				
				var $container = $img.parent();
			
				var imageAspect = $img.attr("width")/$img.attr("height");
				var containerW = $container.width();
		        var containerH = $container.outerHeight();
		        var containerAspect = containerW/containerH;
									
		        if(containerAspect < imageAspect) {
			        $img.css({
		            	width: 'auto',
						height: containerH,
						top: 0,
						left: -Math.round((containerH*imageAspect-containerW)/2)
		            });
		        } else if(containerAspect > imageAspect) {
		        	$img.css({
		            	width: containerW,
						height: 'auto',
						top: -Math.round((containerW/imageAspect-containerH)/2),
						left: 0
		            });
		        } else {
			        $img.removeAttr("style");
		        }
			
			});
		});
	};
}(jQuery));

jQuery.fn.realSize = function() {

	var i = $(this.filter('img')).first();
	
	if(i) {
	
	    if(!i.data('realSize')) {
			
	        var naturalWidth = i[0].naturalWidth;
	        var naturalHeight = i[0].naturalHeight;
			
			if(naturalWidth)
			{
				i.data('realSize', {
			        width: naturalWidth,
			        height: naturalHeight
			    });			    
			}
			else
			{				
		        i.attr("style", "width: auto; height: auto;");
		
		        i.data('realSize', {
			        width: i.width(),
			        height: i.height()
			    });
		
		        i.removeAttr("style");
			}
	    }
	
	    return i.data( 'realSize');
	
	}
	
	return undefined;
};

(function($) {
 	$.fn.loadImage = function(callback) { 			
		return this.each(function() {
			
			var $imgs = $(this).find("img");
						
			$imgs.each(function(){			
				var $img = $(this);
				var obj = this;
				var $parent = $(this).parents(".loading").first();
						
				var toLoad = $img.data("src");
						
				$("<img />").attr("src", toLoad).imagesLoaded().done(function(){

					$img.attr("src", toLoad);
						
					setTimeout(function(){
						$parent.removeClass("loading");
						
						if($parent.parent().is(".slide"))
						{						
							$img.attr("draggable", "false");
						}
						
						$img.addClass("img-loaded");
						
						setTimeout(function(){
							$parent.addClass("white-bg");
						}, 500);
						
						if (typeof callback === 'function') {
					        callback.apply(obj);
					    }
					}, 100);
				});
			});
		});
	};
}(jQuery));

